function GetOperationType(n){$(".operationType").empty();$(".operationType").append('<option value="">Seleziona un tipo<\/option>');$.get("/Action/GetOperationTypes",function(t){let i=$.parseJSON(t);$.get("/User/GetOperationTypeSenderUser/"+n,function(n){let r=$.parseJSON(n).map(n=>n.operationTypeId);for(var t=0;t<i.Result.length;t++)r.indexOf(i.Result[t].id)>=0&&$(".operationType").append('<option value="'+i.Result[t].id+'">'+i.Result[t].typeName+"<\/option>")})})}function GetUsers(){$.get("/User/GetUsers",function(n){for(var i=$.parseJSON(n),t=0;t<i.length;t++)$(".user").append('<option value="'+i[t].id+'">'+i[t].businessName+"<\/option>")})}function GetPreload(){$(".preload").show()}function GetResult(n){$(".preload").hide();var t=$.parseJSON(n);t?location.href="/Action/RequestComplete":alert("Si Ã¨ verificato un errore. Si prega di riprovare")}function CreateRatei(n){if($("#rate-list").empty(),n>0)for(var t=0;t<n;t++)$("#rate-list").append('<div class="col-md-3 col-sm-3"><label>Scadenza RATA '+(t+1)+'<\/label><input type="date" name="rata'+(t+1)+'" required /> <\/div>')}$(document).ready(function(){GetUsers()});